import React from "react";
import Link from "next/link";

import { Row, Col, Image } from "antd";
import { dummy } from "../../../utils/dummy";

const Story = () => {
  return (
    <div className="story">
      <Row gutter={24}>
        <Col sm={24} lg={6}>
          <div className="story-details">
            <div className="poster">
              <Image
                src={dummy.poster}
                alt="poster"
                width={"100%"}
                height={"100%"}
              />
            </div>
            <h2>Becoming</h2>
            <p className="author">
              by{" "}
              <Link href="/profile/1">
                <a>Hawoly Ba</a>
              </Link>
            </p>
          </div>
        </Col>
        <Col sm={24} lg={18}>
          <div className="story-chapters"></div>
        </Col>
      </Row>
    </div>
  );
};

export default Story;
